import {api} from '../utils/api.js';
import { CurrentUserContext } from '../contexts/CurrentUserContext.js';
import React from 'react';
import { Link } from 'react-router-dom';

function Register({}) {
    const user = React.useContext(CurrentUserContext);

    return (
        <main>
            <div>
                <h1 className='popup__title popup__title_dark'>Регистрация</h1>
                <form className='sign__form'>
                    <input className='sign__input' type='email' required minLength="2" placeholder='Email'></input>
                    <input className='sign__input' type='text' required minLength="6" placeholder='Пароль'></input>
                    <button className="sign__button" type="submit">Зарегистрироваться</button>
                    <Link to='/sign-in'>Уже зарегистрированы? Войти</Link>
                </form>
            </div>
        </main>
    )
}
export default Register
